import React from 'react';
import { Link } from 'react-router-dom';
import HeroSection from '../common/HeroSection';
import ServiceCard from '../common/ServiceCard';
import Button from '../common/Button';
import SkygateLogisticsLogo from '../logos/SkygateLogisticsLogo';
import LogisticsFooter from '../layout/LogisticsFooter';

const LogisticsPage = () => {
  const services = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7h12m0 0l-4-4m4 4l-4 4m0 6H4m0 0l4 4m-4-4l4-4" />
        </svg>
      ),
      title: "USA-China Freight Forwarding",
      description: "Complete freight forwarding solutions for USA-China trade routes. We handle air, sea, and land transportation with competitive rates, customs clearance, and real-time tracking. Whether importing electronics from China or exporting agricultural products to China, we ensure seamless delivery.",
      benefits: ["Competitive shipping rates", "Real-time tracking", "Customs clearance included", "Insurance coverage available"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M20 7l-8-4-8 4m16 0l-8 4m8-4v10l-8 4m0-10L4 7m8 4v10M4 7v10l8 4" />
        </svg>
      ),
      title: "Warehousing & Distribution",
      description: "Strategic warehousing solutions across USA and China with advanced inventory management, cross-docking, and fulfillment services. Our warehouses are strategically located near major ports and transportation hubs for efficient distribution.",
      benefits: ["Strategic locations", "Advanced inventory management", "Cross-docking services", "Fulfillment solutions"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
        </svg>
      ),
      title: "Supply Chain Management",
      description: "End-to-end supply chain optimization for USA-China trade. We provide comprehensive supply chain consulting, vendor management, procurement services, and logistics coordination to streamline your operations.",
      benefits: ["End-to-end optimization", "Vendor management", "Procurement services", "Logistics coordination"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
        </svg>
      ),
      title: "Last-Mile Delivery",
      description: "Fast and reliable last-mile delivery services across USA and China. Our network of local delivery partners ensures your packages reach customers quickly and safely, with real-time tracking and delivery confirmation.",
      benefits: ["Fast delivery", "Local network", "Real-time tracking", "Delivery confirmation"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10.325 4.317c.426-1.756 2.924-1.756 3.35 0a1.724 1.724 0 002.573 1.066c1.543-.94 3.31.826 2.37 2.37a1.724 1.724 0 001.065 2.572c1.756.426 1.756 2.924 0 3.35a1.724 1.724 0 00-1.066 2.573c.94 1.543-.826 3.31-2.37 2.37a1.724 1.724 0 00-2.572 1.065c-.426 1.756-2.924 1.756-3.35 0a1.724 1.724 0 00-2.573-1.066c-1.543.94-3.31-.826-2.37-2.37a1.724 1.724 0 00-1.065-2.572c-1.756-.426-1.756-2.924 0-3.35a1.724 1.724 0 001.066-2.573c-.94-1.543.826-3.31 2.37-2.37.996.608 2.296.07 2.572-1.065z" />
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" />
        </svg>
      ),
      title: "Custom Logistics Solutions",
      description: "Tailored logistics solutions designed specifically for your business needs. Whether you need specialized handling for fragile goods, temperature-controlled shipping, or expedited services, we create custom solutions.",
      benefits: ["Tailored solutions", "Specialized handling", "Temperature control", "Expedited services"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3.055 11H5a2 2 0 012 2v1a2 2 0 002 2 2 2 0 012 2v2.945M8 3.935V5.5A2.5 2.5 0 0010.5 8h.5a2 2 0 012 2 2 2 0 104 0 2 2 0 012-2h1.064M15 20.488V18a2 2 0 012-2h3.064M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "International Shipping",
      description: "Comprehensive international shipping services connecting USA and China with the rest of the world. We handle complex international regulations, documentation, and customs procedures to ensure smooth global trade.",
      benefits: ["Global reach", "Regulatory compliance", "Documentation handling", "Customs procedures"]
    }
  ];

  const processSteps = {
    "From USA & China": [
      {
        step: "1",
        title: "Order Processing",
        description: "Receive and process your shipping orders with detailed documentation and requirements analysis."
      },
      {
        step: "2", 
        title: "Pickup & Collection",
        description: "Schedule and execute pickup from your location in USA or China with professional handling."
      },
      {
        step: "3",
        title: "Customs Documentation",
        description: "Prepare all necessary customs documentation, permits, and compliance paperwork."
      },
      {
        step: "4",
        title: "Transportation",
        description: "Arrange optimal transportation via air, sea, or land based on your requirements and timeline."
      },
      {
        step: "5",
        title: "Quality Control",
        description: "Conduct thorough quality checks and packaging verification before final shipment."
      }
    ],
    "To Global Markets": [
      {
        step: "1",
        title: "Destination Planning",
        description: "Plan optimal routes and delivery schedules to your target global markets."
      },
      {
        step: "2",
        title: "International Transit",
        description: "Manage international transit with real-time tracking and status updates."
      },
      {
        step: "3",
        title: "Customs Clearance",
        description: "Handle destination country customs clearance and regulatory compliance."
      },
      {
        step: "4",
        title: "Local Distribution",
        description: "Coordinate with local partners for efficient distribution and delivery."
      },
      {
        step: "5",
        title: "Final Delivery",
        description: "Complete final delivery with confirmation and customer satisfaction tracking."
      }
    ]
  };

  const industries = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19.428 15.428a2 2 0 00-1.022-.547l-2.387-.477a6 6 0 00-3.86.517l-.318.158a6 6 0 01-3.86.517L6.05 15.21a2 2 0 00-1.806.547M8 4h8l-1 1v5.172a2 2 0 00.586 1.414l5 5c1.26 1.26.367 3.414-1.415 3.414H4.828c-1.782 0-2.674-2.154-1.414-3.414l5-5A2 2 0 009 10.172V5L8 4z" />
        </svg>
      ),
      title: "Manufacturing",
      description: "Supporting manufacturing industries with efficient supply chain management and logistics solutions."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9.75 17L9 20l-1 1h8l-1-1-.75-3M3 13h18M5 17h14a2 2 0 002-2V5a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z" />
        </svg>
      ),
      title: "Technology",
      description: "Specialized logistics for technology products including electronics, components, and IT equipment."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4.318 6.318a4.5 4.5 0 000 6.364L12 20.364l7.682-7.682a4.5 4.5 0 00-6.364-6.364L12 7.636l-1.318-1.318a4.5 4.5 0 00-6.364 0z" />
        </svg>
      ),
      title: "Healthcare",
      description: "Temperature-controlled and secure logistics for pharmaceutical and medical equipment."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 11V7a4 4 0 00-8 0v4M5 9h14l1 12H4L5 9z" />
        </svg>
      ),
      title: "Retail & E-commerce",
      description: "Fulfillment and distribution solutions for retail and e-commerce businesses."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7h12m0 0l-4-4m4 4l-4 4m0 6H4m0 0l4 4m-4-4l4-4" />
        </svg>
      ),
      title: "Automotive",
      description: "Specialized logistics for automotive parts, components, and finished vehicles."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M20 7l-8-4-8 4m16 0l-8 4m8-4v10l-8 4m0-10L4 7m8 4v10M4 7v10l8 4" />
        </svg>
      ),
      title: "Food & Beverage",
      description: "Cold chain logistics and specialized handling for food and beverage products."
    }
  ];

  const advantages = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3.055 11H5a2 2 0 012 2v1a2 2 0 002 2 2 2 0 012 2v2.945M8 3.935V5.5A2.5 2.5 0 0010.5 8h.5a2 2 0 012 2 2 2 0 104 0 2 2 0 012-2h1.064M15 20.488V18a2 2 0 012-2h3.064M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "USA-China Expertise",
      description: "Deep understanding of USA-China trade regulations, customs procedures, and market dynamics."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "Advanced Technology",
      description: "State-of-the-art tracking systems, digital platforms, and automated processes for efficiency."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "24/7 Support",
      description: "Round-the-clock customer support and monitoring to ensure your shipments are always on track."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 12a9 9 0 01-9 9m9-9a9 9 0 00-9-9m9 9H3m9 9v-9m0-9v9" />
        </svg>
      ),
      title: "Global Network",
      description: "Extensive network of partners and facilities across USA, China, and global markets."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8c-1.657 0-3 .895-3 2s1.343 2 3 2 3 .895 3 2-1.343 2-3 2m0-8c1.11 0 2.08.402 2.599 1M12 8V7m0 1v8m0 0v1m0-1c-1.11 0-2.08-.402-2.599-1" />
        </svg>
      ),
      title: "Cost-Effective Solutions",
      description: "Competitive pricing with transparent costs and no hidden fees for maximum value."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "Reliable Delivery",
      description: "Proven track record of on-time delivery with comprehensive insurance and risk management."
    }
  ];

  const resources = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6.253v13m0-13C10.832 5.477 9.246 5 7.5 5S4.168 5.477 3 6.253v13C4.168 18.477 5.754 18 7.5 18s3.332.477 4.5 1.253m0-13C13.168 5.477 14.754 5 16.5 5c1.746 0 3.332.477 4.5 1.253v13C19.832 18.477 18.246 18 16.5 18c-1.746 0-3.332.477-4.5 1.253" />
        </svg>
      ),
      title: "Trade Guides",
      description: "Comprehensive guides for USA-China trade regulations, customs procedures, and best practices."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 7h6m0 10v-3m-3 3h.01M9 17h.01M9 14h.01M12 14h.01M15 11h.01M12 11h.01M9 11h.01M7 21h10a2 2 0 002-2V5a2 2 0 00-2-2H7a2 2 0 00-2 2v14a2 2 0 002 2z" />
        </svg>
      ),
      title: "Tools & Calculators",
      description: "Shipping cost calculators, transit time estimators, and logistics planning tools."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
        </svg>
      ),
      title: "Industry Reports",
      description: "Market analysis, trade statistics, and industry insights for USA-China logistics."
    }
  ];

  const handleScrollToServices = () => {
    const element = document.getElementById('logistics-services');
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="min-h-screen">
      {/* Hero Section */}
      <HeroSection
        title="Skygate Logistics"
        subtitle="Empowering Global Trade Through Seamless Logistics Solutions"
        description="Connecting USA and China with the world through comprehensive freight forwarding, warehousing, and supply chain management services. Your trusted partner for international trade and logistics excellence."
        backgroundImage="https://images.unsplash.com/photo-1558618666-fcd25c85cd64?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80"
        ctaButtons={[
          {
            text: "Our Logistics Services",
            onClick: handleScrollToServices,
            variant: "glassmorphism",
            className: "px-12 py-6 text-xl"
          }
        ]}
        branding="logistics"
      />

      {/* Our Logistics Services */}
      <section id="logistics-services" className="py-20 bg-gradient-to-br from-logistics-50 via-logistics-100/30 to-logistics-50 relative overflow-hidden">
        <div className="absolute inset-0 bg-gradient-to-br from-logistics-100/20 via-transparent to-logistics-200/10"></div>
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
          <div className="text-center mb-16">
            <h2 className="text-4xl md:text-5xl font-black text-gray-900 mb-6">
              Our Logistics Services
            </h2>
            <p className="text-xl text-gray-600 max-w-3xl mx-auto leading-relaxed">
              Comprehensive logistics solutions designed to streamline your USA-China trade operations. 
              From freight forwarding to supply chain management, we provide end-to-end services that 
              ensure your goods move efficiently across borders.
            </p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {services.map((service, index) => (
              <div key={index} className="group relative bg-white/80 backdrop-blur-sm rounded-2xl p-8 border-2 border-logistics-200 hover:shadow-floating hover:border-logistics-400 transition-all duration-500">
                <div className="absolute inset-0 bg-gradient-to-br from-logistics-100/20 via-transparent to-logistics-200/10 rounded-2xl opacity-0 group-hover:opacity-15 transition-opacity duration-500"></div>
                <div className="relative z-10">
                  <div className="w-16 h-16 bg-gradient-to-br from-logistics-100 to-logistics-200 rounded-xl flex items-center justify-center mb-6 group-hover:scale-110 transition-transform duration-500">
                    <div className="text-logistics-600">
                      {service.icon}
                    </div>
                  </div>
                  <h3 className="text-xl font-bold text-gray-900 mb-4 group-hover:text-logistics-700 transition-colors duration-500">
                    {service.title}
                  </h3>
                  <p className="text-gray-600 mb-6 leading-relaxed">
                    {service.description}
                  </p>
                  <div className="space-y-2">
                    {service.benefits.map((benefit, idx) => (
                      <div key={idx} className="flex items-center text-sm text-gray-500">
                        <svg className="w-4 h-4 text-logistics-500 mr-2" fill="currentColor" viewBox="0 0 20 20">
                          <path fillRule="evenodd" d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z" clipRule="evenodd" />
                        </svg>
                        {benefit}
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Our Logistics Process */}
      <section className="py-20 bg-gradient-to-br from-logistics-100/40 via-logistics-50 to-logistics-100/30 relative overflow-hidden">
        <div className="absolute inset-0 bg-gradient-to-br from-logistics-200/25 via-transparent to-logistics-300/20"></div>
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
          <div className="text-center mb-16">
            <h2 className="text-4xl md:text-5xl font-black text-gray-900 mb-6">
              Our Logistics Process
            </h2>
            <p className="text-xl text-gray-600 max-w-3xl mx-auto leading-relaxed">
              Streamlined processes designed for efficiency and reliability. Our dual-track approach 
              ensures seamless operations from origin to destination, handling every aspect of your 
              logistics requirements with precision and care.
            </p>
          </div>

          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
            {Object.entries(processSteps).map(([title, steps], index) => (
              <div key={index} className="space-y-8">
                <h3 className="text-2xl font-bold text-gray-900 text-center mb-8">
                  {title}
                </h3>
                <div className="space-y-6">
                  {steps.map((step, stepIndex) => (
                    <div key={stepIndex} className="group relative bg-white/80 backdrop-blur-sm rounded-2xl p-6 border-2 border-logistics-200 hover:shadow-floating hover:border-logistics-400 transition-all duration-500">
                      <div className="absolute inset-0 bg-gradient-to-br from-logistics-100/20 via-transparent to-logistics-200/10 rounded-2xl opacity-0 group-hover:opacity-15 transition-opacity duration-500"></div>
                      <div className="relative z-10 flex items-start space-x-4">
                        <div className="w-12 h-12 bg-gradient-to-br from-logistics-100 to-logistics-200 rounded-full flex items-center justify-center flex-shrink-0">
                          <span className="text-logistics-600 font-bold text-lg">{step.step}</span>
                        </div>
